export const addNewCity = () => {

   let dataCity = {};
    fetch('http://api.openweathermap.org/data/2.5/weather?q=London&appid=8e3145fe3bc2e2e42c29a6c323b46d41&units=metric')
        .then((response) => response.json())
        .then((response) =>
        {

            const dataCity = {name: response.name, temp: response.main.temp};

            return {
                type: "ADD_CITY",
                payload: dataCity
            }

        });
};
